import { calcSum } from ".";

// \u6CE8\u610F self
self.onmessage = ({ data }) => {
  const sum = calcSum(data);
  self.postMessage(sum);
};

// 2. \u4F7F\u7528
// \u65B0\u5EFA\u4E00\u4E2A\u7EBF\u7A0B,\u4F20\u5165\u76F8\u5BF9\u8DEF\u5F84
const calcWorker = new Worker(new URL("../calc-worker", import.meta.url), {
  type: "module",
});
// \u7EBF\u7A0B\u4E4B\u95F4\u901A\u8FC7 postMessage \u8FDB\u884C\u901A\u4FE1
calcWorker.postMessage(value);
